CREATE TABLE IF NOT EXISTS `food_variety_sort` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '粮食品种分类-国家平台分类',
  `variety_key` varchar(32)  NOT NULL COMMENT '物料品种国标编码',
  `variety_value` varchar(100)  NOT NULL COMMENT '物料品种名称',
  `sort_type_one` varchar(5)  DEFAULT NULL COMMENT '分类1',
  `sort_type_two` varchar(5)  DEFAULT NULL COMMENT '分类2',
  `sort_type_three` varchar(5)  DEFAULT NULL COMMENT '分类3',
  `create_by` varchar(50)  DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(50)  DEFAULT NULL COMMENT '最后更新者',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `region_id` varchar(10)  NOT NULL DEFAULT '-1' COMMENT '行政区域ID',
  `country_id` varchar(10)  NOT NULL DEFAULT '-1' COMMENT '国ID',
  `province_id` varchar(10)  NOT NULL DEFAULT '-1' COMMENT '省ID',
  `city_id` varchar(10)  NOT NULL DEFAULT '-1' COMMENT '市ID',
  `area_id` varchar(10)  NOT NULL DEFAULT '-1' COMMENT '区ID',
  `enterprise_id` varchar(18)  NOT NULL DEFAULT '-1' COMMENT '企业ID',
  `stock_house_id` varchar(21)  NOT NULL DEFAULT '-1' COMMENT '库区ID',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB COMMENT='粮食品种分类-国家平台分类';


